import Modal from 'react-bootstrap/Modal';
import Button from 'react-bootstrap/Button';
import "bootstrap/dist/css/bootstrap.min.css";

const MyModal = (props) => {
    return (
        <Modal show={props.show} centered>

          <Modal.Body>
              <p>Welcome to MessyDesk! </p>
              <p> MessyDesk is a minimal online collaborative notepad </p>
              <div className='row'>
                <Button onClick={props.createTable}>Create a Table</Button>
                <Button onClick={props.joinTable}>Join a Table</Button>
              </div>
          </Modal.Body>
          <Modal.Footer><Button onClick={props.onHide}>Close</Button></Modal.Footer>
        </Modal>
      );

}

export default MyModal;
